import React, {useEffect, useState} from 'react'
import AOS from 'aos';
import 'aos/dist/aos.css';
import SkillBar from 'react-skillbars';
import itskills from "./It_Skills"
import socialskills from "./Social_skills"
import languageskills from "./LinguisticProficiency";
import otherskills from "./Other_Skills"
import BtnSlider from "./BtnSlider"




function Skills() {
  useEffect(()=>{AOS.init({duration: 1500});},[]);
  const [slideIndex, setSlideIndex] = useState(1);

  const nextSlide = ()=>{}
  const prevSlide = ()=>{}

  return (
    <div id="skills-div" data-aos="fade-up">
      <h2>skills</h2>
        <BtnSlider />
        <div>
          <h3>social skills</h3>
          <p id="skillbar-p"><SkillBar height={20} skills={itskills}/></p>
        </div>

        <div>
          <h3>informatics skills</h3>
          <p id="skillbar-p"><SkillBar height={20} skills={socialskills}/></p>
        </div>

        <BtnSlider />
        <div>
          <h3>linguistic proficiency</h3>
          <p id="skillbar-p" ><SkillBar height={20} skills={languageskills}/></p>
        </div>
        <div>
          <h3>other skills</h3>
          <p id="skillbar-p" ><SkillBar height={20} skills={otherskills}/></p>
        </div>


      ____________________________________________________________________
    </div>
  )
}

export default Skills
